import {ALL_ITEMS, LOGIN, REGISTER, RESOURCE} from "./constants";

export const allItems = (data) => ({type: ALL_ITEMS, payload: data});
export const expectedResource = (data) => ({type: RESOURCE, payload: data});
export const loginAction = (data) => ({ type: LOGIN, payload: data });
export const register = (data) => ({ type: REGISTER, payload: data });
